import './App.css';
import Header from './components/header/Header';
import Introduce from './components/introduce-section/Introduce';
import Tools from './components/tools/Tools';
import Feature from './components/feature/Feature';
function App() {
  return (
    <div className="App">
      <Header></Header>
      <Introduce></Introduce>
      <Tools></Tools>
      <Feature></Feature>
    </div>
  );
}

export default App;
